cal context of creative works and teach you to review source material critically, draw connections between diverse ideas, and evaluate evidence and arguments. Coursework in this field will help you become a better reader, thinker, artist, and writer.","id":"arts-and-humanities"},{"subdomainIds":["leadership-and-management","finance","marketing","entrepreneurship","business-essentials","business-strategy"],"keywords":["small business","international business","business administration","business management","opportunities","sell","finance","economic","global","ethics","investment"],"name":"Business","description":"Business Specializations and courses help you hone skills critical to success in the modern workplace, with areas of study including entrepreneurship, business strategy, marketing, finance, and management. Whether you're a small business owner or working in a large international firm, business courses will improve your ability to analyze, understand, and solve business problems.","id":"business"},{"subdomainIds":["software-development","mobile-and-web-development","algorithms","computer-security-and-networks","design-and-product"],"keywords":["program","engineering","introduction","theoretical","mathematics","projects","computational science","technology","networking","graphics","applications","algorithms","programming"],"name":"Computer Science","description":"Computer science Specializations and courses teach software engineering and design, algorithmic thinking, human-computer interaction, programming languages, and the history of computing. Courses in this broad field will help you think abstractly, approach problems methodically, and develop sound solutions.","id":"computer-science"},{"subdomainIds":["data-analysis","machine-learning","probability-and-statistics"],"keywords":["qualitative data analysis","exploratory data analysis","tools","methods","techniques","software","research","analyst","interpretation"],"name":"Data Science","description":"Data science Specializations and courses teach the fundamentals of interpreting data, performing analyses, and understanding and communicating actionable insights. Topics of study for beginning and advanced learners include qualitative and quantitative data analysis, tools and methods for data manipulation, and machine learning algorithms.","id":"data-science"},{"subdomainIds":["cloud-computing","security","data-management","networking","support-and-operations"],"keywords":["networking","cloud computing","security","data management","operations"],"name":"Information Technology","description":"Information Technology (IT) courses and specializations teach cloud computing, cyber security, data management, networking, and more. Learn to use computers to meet day-to-day business needs and launch or advance your career in the IT industry.","id":"information-technology"},{"subdomainIds":["animal-health","basic-science","health-informatics","healthcare-management","nutrition","patient-care","public-health","research","psychology"],"keywords":["science","cellular","molecular","agriculture","companies","branches","impact factor","bio","biotechnology","zoology","biology","neuroscience","horticulture","biochemistry","plant"],"name":"Health","description":"Health Specializations and courses explore topics related to science, your health, and the health and well being of others. Whether you're interested in science, a trained healthcare professional, or looking to transition into this rapidly growing industry, health courses will improve your ability to understand animal and plant life, use big data to solve key health challenges, manage teams, and conduct evidence-based research.","id":"life-sciences","slug":"health"},{"subdomainIds":["math-and-logic"],"keywords":["problems","logical","mathematical","philosophy","calculator","puzzles","logically","thinking","reasoning","fallacies","computational","symbols","solving","applications","everyday","models"],"name":"Math and Logic","descript isions, behave in groups, and structure their communities. From education to economics to law, courses in the social sciences will improve your understanding of the dynamics between individuals and groups, and your ability to analyze behaviors and trends.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lessons","learn","language learning","learn chinese","learn english","english language courses","learn to speak","foreign language","spanish","other languages","grammar","speaking","conversation","writing"],"name":"Language Learning","description":"In language courses and Specializations, you’ll learn to speak, write, and listen effectively in major global languages, including English, Chinese, Spanish, and more. Whether you’re learning a foreign language or improving your communication skills in your native language, coursework in this area will help you understand grammar and syntax conventions, and will prepare you to communicate with confidence in both business interactions and casual conversation.","id":"language-learning"}],"courseId":"OF6XosxhEey2yRJ62irIQQ","courseSlug":"database-engineer-capstone","courseCertificates":["VerifiedCert","Specialization"],"courseTypeMetadata":{"typeName":"standardCourse","definition":{"typeNameIndex":"standardCourse"}},"rawCourseMaterials":{"courseData":{"isReal":true,"certificatePurchaseEnabledAt":1651747847126,"estimatedWorkload":"4 weeks of study, 3-5 hours\u002Fweek.","description":"In this course you’ll complete a capstone project in which you’ll create a database and client for Little Lemon restaurant.\n\nTo complete this course, you will need database engineering experience.  \n\nThe Capstone project enables you to demonstrate multiple skills from the Certificate by solving an authentic real-world problem. Each module includes a brief recap of, and links to, content that you have covered in previous courses in this program. \n\nIn this course, you will demonstrate your new skill "hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EA basic working knowledge of a standard computer operating system such as Microsoft Windows or Apple Mac, alongside familiarity with an internet browser such as Google Chrome or Microsoft Edge. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat is a database?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat is a database?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EA database is a software tool that facilitates the electronic storage of systematically organized data. There are many different types of databases. In this program, you’ll learn how to build, maintain and optimize various types of databases.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EA database is a software tool that facilitates the electronic storage of systematically organized data. There are many different types of databases. In this program, you’ll learn how to build, maintain and optimize various types of databases.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat does a database do?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat does a database do?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EA database stores data so that it can be analyzed, manipulated and distributed amongst its users. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EA database stores data so that it can be analyzed, manipulated and distributed amongst its users. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat is SQL?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat is SQL?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ESQL, or Structured Query Language, is a computer language used to communicate with a database through a set of instructions, or statements. It can be used with all types of databases.&#xa0;\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ESQL, or Structured Query Language, is a computer language used to communicate with a database through a set of instructions, or statements. It can be used with all types of databases.&nbsp;\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat does a database engineer do?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat does a database engineer do?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDatabase engineers create and maintain databases. They design the database engine processes for sorting and accessing information. They use programming knowledge to build data pipelines and integrate new information into existing databases. Furthermore, they develop new databases based on company needs, data storage needs, and the number of users using the database.\u003C\u002Ftext\u003E\u003Ctext\u003EIf you like thinking analytically, improving processes and have a knack for solving problems, this is a great career path for you. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDatabase engineers create and maintain databases. They design the database engine processes for sorting and accessing information. They use programming knowledge to build data pipelines and integrate new information into existing databases. Furthermore, they develop new databases based on company needs, data storage needs, and the number of users using the database.\u003C\u002Fp\u003E\u003Cp\u003EIf you like thinking analytically, improving processes and have a knack for solving problems, this is a great career path for you. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat type of companies hire database engineers?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat type of companies hire database engineers?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDatabase engineers are needed in nearly every industry, every business and for every function. They help build, design and implement digital databases. The demand for this skillset has grown immensely over the last year and will continue to rise as new technologies emerge. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDatabase engineers are needed in nearly every industry, every business and for every function. They help build, design and implement digital databases. The demand for this skillset has grown immensely over the last year and will continue to rise as new technologies emerge. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat jobs will this prepare me for?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat jobs will this prepare me for?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThere are multiple branches of software engineering you can specialize in, and each one comes with a unique set of responsibilities. This program is designed to prepare people for a career as a database engineer. This includes job titles such as database engineer, data engineer, data architect, database administrator, solutions architect, analytics engineer, machine learning engineer, software engineer, data platform engineer, and so many more.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EData engineering skills are also helpful for adjacent roles, such as data analysts and data scientists. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThere are multiple branches of software engineering you can specialize in, and each one comes with a unique set of responsibilities. This program is designed to prepare people for a career as a database engineer. This includes job titles such as database engineer, data engineer, data architect, database administrator, solutions architect, analytics engineer, machine learning engineer, software engineer, data platform engineer, and so many more.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EData engineering skills are also helpful for adjacent roles, such as data analysts and data scientists. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy start a career in software engineering?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy start a career in software engineering?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ESoftware Engineers are among the highest-paid jobs in the tech industry and the need for this skillset is on the rise. This career path is projected to grow by 22% by 2030 which is faster than the average projected rate of growth for all occupations (5%). In 2020, there were more than 1.8 million jobs in the U.S. alone\u003Ca href=\"https:\u002F\u002Fwww.bls.gov\u002Fooh\u002Fcomputer-and-information-technology\u002Fsoftware-developers.htm\" title=\"\"\u003E*\u003C\u002Fa\u003E.\u003C\u002Ftext\u003E\u003Ctext\u003EPlus, businesses need high-quality, engaging apps to reach more people, increase exposure and drive more revenue. On the other hand, consumers want apps that make their everyday lives simpler. As a result, there is a high demand for iOS developers to create new user-friendly applications and improve the efficiency of existing apps.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ESoftware Engineers are among the highest-paid jobs in the tech industry and the need for this skillset is on the rise. This career path is projected to grow by 22% by 2030 which is faster than the average projected rate of growth for all occupations (5%). In 2020, there were more than 1.8 million jobs in the U.S. alone\u003Ca href=\"https:\u002F\u002Fwww.bls.gov\u002Fooh\u002Fcomputer-and-information-technology\u002Fsoftware-developers.htm\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003E*\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\u003Cp\u003EPlus, businesses need high-quality, engaging apps to reach more people, increase exposure and drive more revenue. On the other hand, consumers want apps that make their everyday lives simpler. As a result, there is a high demand for iOS developers to create new user-friendly applications and improve the efficiency of existing apps.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy should I earn a Meta certificate?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy should I earn a Meta certificate?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Meta Developer Certificates are for anyone who has a passion for tech and wants to build a career in this field, no degree or experience necessary. Upon completion, you’ll earn career credentials from Meta that you can add to your resume and portfolio. A Meta Certificate is an industry-recognized credential that helps boost confidence and gives you a competitive advantage when applying to jobs.&#xa0;&#xa0;\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Meta Developer Certificates are for anyone who has a passion for tech and wants to build a career in this field, no degree or experience necessary. Upon completion, you’ll earn career credentials from Meta that you can add to your resume and portfolio. A Meta Certificate is an industry-recognized credential that helps boost confidence and gives you a competitive advantage when applying to jobs.&nbsp;&nbsp;\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat resources will be available to help me with my job search?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat resources will be available to help me with my job search?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWe’ll guide you through each step to ensure you master the core programming skills at a pace that works for you. You’ll get expert-led training and build on-the-job experience through hands-on projects that you can add to your portfolio and show to recruiters.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EWe’ll help you develop a strong portfolio, a polished resume and sharp interview skills. We’ll prepare you for what to expect when interviewing for relevant roles and we’ll share tips for what employers are looking for in potential candidates.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EFinally, you’ll also get to discuss the emotional components of the interview process with other learners taking this course. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWe’ll guide you through each step to ensure you master the core programming skills at a pace that works for you. You’ll get expert-led training and build on-the-job experience through hands-on projects that you can add to your portfolio and show to recruiters.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EWe’ll help you develop a strong portfolio, a polished resume and sharp interview skills. We’ll prepare you for what to expect when interviewing for relevant roles and we’ll share tips for what employers are looking for in potential candidates.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EFinally, you’ll also get to discuss the emotional components of the interview process with other learners taking this course. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy did Meta create this program?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy did Meta create this program?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EMeta is committed to ensuring that anyone regardless of education, background or experience has the opportunity to learn in-demand skills so they can land an in-demand career. We're excited to provide these pathways so that millions of people can unlock greater opportunities for their lives and families. Upon completing this program, you’ll be well positioned to start your career as a software engineer.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EMeta is committed to ensuring that anyone regardless of education, background or experience has the opportunity to learn in-demand skills so they can land an in-demand career. We're excited to provide these pathways so that millions of people can unlock greater opportunities for their lives and families. Upon completing this program, you’ll be well positioned to start your career as a software engineer.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow long does it take to complete the specialization?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow long does it take to complete the specialization?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThis program will take approximately 3 months to complete, learning 10 hours a week. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThis program will take approximately 3 months to complete, learning 10 hours a week. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat background knowledge is necessary?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat background knowledge is necessary?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ENone! Whether you’re just starting out or are a professional in a relevant field, we are dedicated to helping you succeed. You should have a basic working knowledge of a standard computer operating system such as Microsoft Windows or Apple Mac, alongside familiarity with an internet browser such as Google Chrome or Microsoft Edge. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ENone! Whether you’re just starting out or are a professional in a relevant field, we are dedicated to helping you succeed. You should have a basic working knowledge of a standard computer operating system such as Microsoft Windows or Apple Mac, alongside familiarity with an internet browser such as Google Chrome or Microsoft Edge. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDo I need a certain device to take this course?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDo I need a certa
